import React from 'react';
import ReactDOM from 'react-dom/client';
import MenuItem from './MenuItem';

export default  class SideBar extends React.Component{
    constructor(props) {
        super(props)
    }

    render() {
        return (
            <ul className="nav nav-pills flex-column mb-auto">
                <MenuItem itemName="customization" itemIcon="bi bi-brush" itemDisplayName="Personalizza" />
                <MenuItem itemName="services" itemIcon="bi bi-share" itemDisplayName="Servizi" />
            </ul>
        )
    }
}
